edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/share_target_supported_renderers.proto";
import "youtube/api/innertube/accessibility_supported_datas.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message ThirdPartyShareTargetSectionRenderer {
	repeated ShareTargetSupportedRenderers share_targets = 1;
	bytes tracking_params = 3;
	AccessibilitySupportedDatas accessibility = 4;
}
